import * as React from "react";
import logo from './assets/logo.png'
import NavigationPanel from "./components/NavigationPanel/NavigationPanel";
import S from "./root.module.css"
import {SimpleSlider} from "./components/slickSlider/SimpleSlider";
import Slider from "react-slick";


function SampleNextArrow(props) {
    const { className, style, onClick } = props;
    return (
        <div
            className={className}
            style={{ ...style, display: "none", background: "red" }}
            onClick={onClick}
        />
    );
}

function SamplePrevArrow(props) {
    const { className, style, onClick } = props;
    return (
        <div
            className={className}
            style={{ ...style, display: "none", background: "green" }}
            onClick={onClick}
        />
    );
}
export default function Root() {
    const settings = {
        dots: false,
        infinite: true,
        speed: 500,
        slidesToShow: 1,
        slidesToScroll: 1,
        autoplay: true,
        autoplaySpeed:5000,
        fade: true,
        nextArrow: <SampleNextArrow />,
        prevArrow: <SamplePrevArrow />

    };

    return (
        <div className={S.root}>
            {/*<div style={{height:'100%'}}>*/}
            {/*    <video autoPlay muted loop className={S.myVideo}*/}
            {/*    >*/}
            {/*        <source src="https://apextest12.b-cdn.net/vid1.mp4" type="video/mp4"/>*/}
            {/*    </video>*/}
            {/*</div>*/}
        <Slider {...settings} >

        <div style={{height:'100%'}}>
            <video autoPlay muted loop className={S.myVideo}
                   >
                <source src="https://apextest12.b-cdn.net/vid1.mp4" type="video/mp4"/>
            </video>
        </div>
        <div style={{height:'100%'}}>
            <video autoPlay muted loop className={S.myVideo}
                   ><source src="https://apextest12.b-cdn.net/vid2.mp4" type="video/mp4"/>
            </video>
        </div>
        <div style={{height:'100%'}}>
            <video autoPlay muted loop className={S.myVideo}>
                <source src="https://apextest12.b-cdn.net/vid3.mp4" type="video/mp4"/>
            </video>
        </div>
    </Slider>
    {/*<section className={S.header}>*/
    }
    {/*    <picture>*/
    }
    {/*        <img src={logo} alt='ApexLogo'/>*/
    }
    {/*    </picture>*/
    }
    {/*<NavigationPanel/>*/
    }
    {/*</section>*/
    }
    {/*<video autoPlay muted loop className={S.myVideo} >*/
    }
    {/*    <source src="https://apextest12.b-cdn.net/vid1.mp4" type="video/mp4"/>*/
    }
    {/*</video>*/
    }
    {/*<SimpleSlider/>*/
    }
    </div>)


}
